import{_ as e,o,c as i,O as n}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 18.2-67.5:1 Punishment upon conviction of third misdemeanor offense.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/18.2-67.5:1.md","filePath":"vacode/18.2-67.5:1.md"}'),r={name:"vacode/18.2-67.5:1.md"},t=n('<h1 id="§-18-2-67-5-1-punishment-upon-conviction-of-third-misdemeanor-offense" tabindex="-1">§ 18.2-67.5:1 Punishment upon conviction of third misdemeanor offense. <a class="header-anchor" href="#§-18-2-67-5-1-punishment-upon-conviction-of-third-misdemeanor-offense" aria-label="Permalink to &quot;§ 18.2-67.5:1 Punishment upon conviction of third misdemeanor offense.&quot;">​</a></h1><p>When a person is convicted of sexual battery in violation of § <a href="http://law.lis.virginia.gov/vacode/18.2-67.4/" target="_blank" rel="noreferrer">18.2-67.4</a>, attempted sexual battery in violation of subsection C of § <a href="http://law.lis.virginia.gov/vacode/18.2-67.5/" target="_blank" rel="noreferrer">18.2-67.5</a>, a violation of § <a href="http://law.lis.virginia.gov/vacode/18.2-371/" target="_blank" rel="noreferrer">18.2-371</a> involving consensual intercourse, anal intercourse, cunnilingus, fellatio, or anilingus with a child, indecent exposure of himself or procuring another to expose himself in violation of § <a href="http://law.lis.virginia.gov/vacode/18.2-387/" target="_blank" rel="noreferrer">18.2-387</a>, or a violation of § <a href="http://law.lis.virginia.gov/vacode/18.2-130/" target="_blank" rel="noreferrer">18.2-130</a>, and it is alleged in the warrant, information, or indictment on which the person is convicted and found by the court or jury trying the case that the person has previously been convicted within the 10-year period immediately preceding the offense charged of two or more of the offenses specified in this section, each such offense occurring on a different date, he is guilty of a Class 6 felony.</p><p>1994, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0468" target="_blank" rel="noreferrer">468</a>; 2006, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0875" target="_blank" rel="noreferrer">875</a>; 2014, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0794" target="_blank" rel="noreferrer">794</a>.</p>',3),a=[t];function s(l,c,f,h,d,p){return o(),i("div",null,a)}const _=e(r,[["render",s]]);export{g as __pageData,_ as default};
